import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: var(--darkGrey)

`;

export const Content = styled.div`
    width: 100vw;
    height: 300px;
    position: relative;


.image_carousel_container {
    width: 100%;
    height: 100%;
    position: absolute;

}

.carousel_image {
    width: 100%;
    height: 100%;
    background-size: fit;
    bac
    background-position: center;

}

`;
